#include <stdio.h>#include <stdlib.h>#include <iostream>using namespace std;#define ifor(X)		for(int i = 0;i < X;++i)#define jfor(X)		for(int j = 0;j < X;++j)int num;char words[1000][21];//文字列比較int compare(const char* x,const char* y){	//現在比較中の文字数	int w = 0;		//別文字ならば普通に評価	RECHECK:	if(*x - *y)return int(*x - *y);		//同じ文字なら次の文字を見る	else{		//アドレスを動かす		ifor( (signed int)(sizeof(char)) ){++x;++y;}				//文字数を数える		++w;				//20文字目まで同じならあきらめる		if(w == 20)return 0;				//次の文字に進む		goto RECHECK;	}}int main(){	//文字数を受け取る	cin >> num;		//ソート対象数を受け取る	ifor(num)scanf("%s",words[i]);		//ソートする	qsort(&words[0][0],num,sizeof(char) * 21, (int(*)(const void*,const void*))compare );		//出力する	puts(words[0]);}